import SHOP_DATA from './shop.data'
const INITIAL_STATE={
    item:[1,2]
}

const sopReducer=(state=INITIAL_STATE,action)=>{
    switch (action.type){
        default: 
        console.log(state)
        return state;
    }
}
export default sopReducer
